textOriginal:
Seja bendito o nome de Deus para todo o sempre, porque dele é a sabedoria e a força;
Ele muda os tempos e as horas; ele remove os reis e estabelece os reis: ele dá sabedoria aos sábios e ciência aos inteligentes.
Ele revela o profundo e o escondido. Ele conhece o que está em trevas, e com ele mora a luz.
